function BaseCtrl($scope, $rootScope, $routeParams, ngAppSettings, service) {

    $scope.request = angular.copy(ngAppSettings.request);
    $scope.contentStatuses = angular.copy(ngAppSettings.contentStatuses);
    $scope.activedData = null;
    $scope.data = null;
    $scope.isInit = false;
    $scope.errors = [];
    $scope.saveCallbackArgs = [];
    $scope.removeCallbackArgs = [];
    $scope.range = $rootScope.range;

    $scope.getSingle = async function () {
        $rootScope.isBusy = true;
        var id = $routeParams.id;
        var resp = await service.getSingle([id, 'portal']);
        if (resp && resp.isSucceed) {
            $scope.activedData = resp.data;
            $rootScope.isBusy = false;
            $scope.$apply();
        }
        else {
            if (resp) { $rootScope.showErrors(resp.errors); }
            $rootScope.isBusy = false;
            $scope.$apply();
        }
    };
    $scope.getList = async function (dataIndex) {
        if (dataIndex !== undefined) {
            $scope.request.dataIndex = dataIndex;
        }
        if ($scope.request.fromDate !== null) {
            var d = new Date($scope.request.fromDate);
            $scope.request.fromDate = d.toISOString();
        }
        if ($scope.request.toDate !== null) {
            var d = new Date($scope.request.toDate);
            $scope.request.toDate = d.toISOString();
        }
        var resp = await service.getList($scope.request);
        if (resp && resp.isSucceed) {

            ($scope.data = resp.data);
            $.each($scope.data.items, function (i, data) {

                $.each($scope.activedDatas, function (i, e) {
                    if (e.dataId === data.id) {
                        data.isHidden = true;
                    }
                });
            });
            $rootScope.isBusy = false;
            $scope.$apply();
        }
        else {
            if (resp) { $rootScope.showErrors(resp.errors); }
            $rootScope.isBusy = false;
            $scope.$apply();
        }
    };

    $scope.remove = function (id) {
        $rootScope.showConfirm($scope, 'removeConfirmed', [id], null, 'Remove', 'Are you sure');
    };

    $scope.removeConfirmed = async function (id) {
        $rootScope.isBusy = true;
        var result = await service.delete(id);
        if (result.isSucceed) {
            if ($scope.removeCallback) {
                $rootScope.executeFunctionByName('removeCallback', $scope.removeCallbackArgs, $scope)
            }
            $scope.getList();
        }
        else {
            $rootScope.showMessage('failed');
            $rootScope.isBusy = false;
            $scope.$apply();
        }
    };

    $scope.save = async function (data) {
        $rootScope.isBusy = true;
        var resp = await service.save(data);
        if (resp && resp.isSucceed) {
            $scope.activedData = resp.data;
            $rootScope.showMessage('success', 'success');
            
            if ($scope.saveCallback) {
                $rootScope.executeFunctionByName('saveCallback', $scope.saveCallbackArgs, $scope)
            }
            $rootScope.isBusy = false;
            $scope.$apply();
        }
        else {
            if (resp) { $rootScope.showErrors(resp.errors); }
            $rootScope.isBusy = false;
            $scope.$apply();
        }
    };

}
function BaseHub($scope) {
    $scope.isLog = true;
    $scope.connection = null;
    $scope.host = "/";
    $scope.responses = [];
    $scope.requests = [];
    $scope.rooms = [];
    $scope.others = [];

    $scope.connect = function () {
        $scope.connection.invoke('join', $scope.player);
    };
    $scope.sendMessage = function () {
        $scope.connection.invoke('SendMessage', $scope.request);
    };
    $scope.receiveMessage = function (msg) {
        $scope.responses.splice(0, 0,msg);
        $scope.$applyAsync();
    };
    $scope.prettyJsonObj = function(obj) {
        return JSON.stringify(obj, null, '\t');
    }
    // Starts a connection with transport fallback - if the connection cannot be started using
    // the webSockets transport the function will fallback to the serverSentEvents transport and
    // if this does not work it will try longPolling. If the connection cannot be started using
    // any of the available transports the function will return a rejected Promise.
    $scope.startConnection = function (hubName) {

        $scope.connection = new signalR.HubConnectionBuilder()
            .withUrl($scope.host + hubName)
            .configureLogging(signalR.LogLevel.Information)
            .build();
        // Create a function that the hub can call to broadcast messages.

        $scope.connection.on("ReceiveMessage", (resp) => {
            $scope.receiveMessage(resp);
        });
        $scope.connection.start()
            .then(function () {
                console.log('connection started', $scope.connection);

                //$scope.$apply();
            })
            .catch(function (error) {
                console.log(`Cannot start the connection use transport.`, error);
                return Promise.reject(error);
            });
    };

    $scope.$on("$destroy", function () {
        $scope.connection.stop();
    });
};
